CHS=\"x86_64 i386\" \\\n           BUILD_DIR=\"${BUILD_DIR}\" \\\n           BUILD_ROOT=\"${BUILD_ROOT}\" \\\n           clean build\n\n# Step 4: Copy the framework structure (from iphoneos build) to the universal folder\necho =================\necho COPYING FRAMEWORK\necho\n\ncp -r \"${BUILD_DIR}/${CONFIGURATION}-${DEVICE_OS}/${FRAMEWORK_NAME}.framework\" \"${UNIVERSAL_BUILD_FOLDER}\"\n\n# Step 5: Create universal binary file using lipo and place the combined executable in the copied framework directory\necho ============================\necho CREATING UNIVERSAL FRAMEWORK\necho\n\n# Merge the two frameworks together\nlipo -create -output \"${UNIVERSAL_BUILD_FOLDER}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \\\n                     \"${BUILD_DIR}/${CONFIGURATION}-${DEVICE_SIMULATOR}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \\\n                     \"${BUILD_DIR}/${CONFIGURATION}-${DEVICE_OS}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\n# Copy across the device build symbols\ncp -r \"${DEVICE_DSYM_PATH}\" \"${UNIVERSAL_OUTPUT_FOLDER}/\" | echo\n\n# Merge the symbols together\nlipo -create -output \"${UNIVERSAL_OUTPUT_FOLDER}/${FRAMEWORK_NAME}.framework.dSYM/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \\\n                     \"${DEVICE_DSYM_PATH}/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" \\\n                     \"${SIMULATOR_DSYM_PATH}/Contents/Resources/DWARF/${FRAMEWORK_NAME}\" || exit 1\n\n# Step 6: Convenience step to copy the framework to the project's directory\necho ===========================\necho COPYING UNIVERSAL FRAMEWORK\necho\n\ncp -r \"${UNIVERSAL_BUILD_FOLDER}/${FRAMEWORK_NAME}.framework\" \"${UNIVERSAL_OUTPUT_FOLDER}/\"\n\n# Step 7: Create the universal symbol file\necho ==========================\necho CREATING UNIVERSAL SYMBOLS\necho\n\nUUIDs=$(dwarfdump --uuid \"${DEVICE_DSYM_PATH}\" | cut -d ' ' -f2)\nfor file in `find \"${DEVICE_BCSYMBOLMAP_PATH}\" -name \"*.bcsymbolmap\" -type f`; do\n    fileName=$(basename \"$file\" \".bcsymbolmap\")\n    for UUID in $UUIDs; do\n        if [[ \"$UUID\" = \"$fileName\" ]]; then\n            dsymutil --symbol-map \"$file\" \"${UNIVERSAL_OUTPUT_FOLDER}/${FRAMEWORK_NAME}.framework.dSYM\"\n            cp -R \"$file\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\n        fi\n    done\ndone\n";
		};
